import PhotoCreate from './PhotoCreate';
import PhotoEdit from './PhotoEdit';
import PhotoList from './PhotoList';
import PhotoList2 from './PhotoList2';
import PhotoShow from './PhotoShow';
import PhotoIcon from '@material-ui/icons/PhotoLibrary';

export default {
    list: PhotoList2,
    create: PhotoCreate,
    edit: PhotoEdit,
    show: PhotoShow,
    icon: PhotoIcon
};
